import Register from "./pages/register/Register";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


function App() {
  return (
   <Router>
    <Routes>
      <Route path="/login" element={<Login/>}/>

    </Routes>
   </Router>
  );
}

export default App;
